import React from "react";
import "./Styles/Pages.css";

const About = () => {
  return (
    <div id="About">
      <head>
        <title>About Us</title>
      </head>
      <div className="title">
        <h1>Halaman About</h1>
      </div>
  </div>
  );
};

export default About;
